  render() {
    return (
      <div data-testid="page-search">
        <h1>Search</h1>
        <Header />

        <form>
          <label htmlFor="search-input">
            <input id="search-input" />
          </label>
          <button type='submit' data-testid="search-artist-button">

          </button>
        </form>
      </div>
    );
  }
}

export default Search;
